import React, { Component } from "react";
import { Router, Switch, Route } from "react-router-dom";

import NewRootRootRoot1 from "./NewRootRootRoot1/ NewRootRootRoot1";
//import Contact from "./Contact/Contact";
//import Products from "./Product/Products";
import DesktopRootRoot1 from "./DesktopRootRoot1/DesktopRootRoot1";
import history from './history';

export default class Routes extends Component {
    render() {
        return (
            <Router history={history}>
                <Switch>
                    <Route path="/" exact component={DesktopRootRoot1} />
                    <Route path="/NewRootRootRoot1" component={NewRootRootRoot1} />

                </Switch>
            </Router>
        )
    }
}
